import HomePage from "./HomePage";
import Posts from "./Posts";
import Blogs from "./Blogs";
import data from "./Data";

 export default function Main() {
    const blogs = data.map(item => {
        return (
            <Blogs />
        )
    })    

  return (
    <div>
     <HomePage />
     <Posts />
     <sector>
         {blogs}
     </sector>
    </div>
  );
}
